	SELECT * 
	FROM articulos
	WHERE (active = pActive OR -1 = pActive) 
    AND idArticulo = COALESCE(pIdArticulo,idArticulo)
    AND (pIdCategoria IS NULL OR categoria LIKE CONCAT('%', pIdCategoria, '%'))
    AND (pNombre IS NULL OR nombre LIKE CONCAT('%', pNombre, '%'))
    AND (pDescripcion IS NULL OR descripcion LIKE CONCAT('%', pDescripcion, '%'));
END$$

